import React from 'react';
import axios from 'axios';

const User = ({users}) => (
  <div>
    <ul>
      { console.log(users)}
    </ul>
  </div>
);

User.getInitialProps = async () => {
  const response = await axios.get(
    'https://swapi.co/api/people/'
    );

  return { users: response.results.name};
}

export default User;
